import React from 'react';
import {jobs} from './data';
import Card from './Card';

const Cardlist = () => {
    return(
        <div>
        {
           jobs.map(job => {
               const {image,company,date,position,details,skills} = job;
               return <Card image={image} 
                            company={company} 
                            date={date} 
                            position={position} 
                            details={details} 
                            skills={skills}/>
           }) 
        }
        </div>
    )
}

export default Cardlist;
